import React, { Component } from 'react';
import './Navbar.css';

export default class Navbar extends Component {
    state = {
        click
    }
    render() {
        return (
            <nav className="navbar">

                {/* Logo Section */}
                <div className="logo">React
                    <i className="fab fa-react"></i>
                </div>

                {/* mobile toggler */}
               <div className="menuIcon">
               <i className=""></i>
               </div>

            </nav>
        )
    }
}
